                </td>
                <td className="col-2">
                  <p>{user.email}</p>
                </td>
                <td className="col-3">
                  <p>{user._id}</p>
                </td>
                <td className="col-4">
                  <p>{user.phoneNumber}</p>
                </td>
                <td className="col-5">
                  <p>
                    <Link to="/updateUser">Update</Link>
                    (..)
                    <DeleteUser />
                  </p>
                </td>
              </div>
            </tr>
          ))}
        </table> */}

        <table>
          <tr>
            {Object.keys(users[0])?.map((key) => (
              <th id={key._id}>{key}</th>
            ))}
          </tr>
          {users?.map((item) => (
            <tr key={item.id}>
              {Object.values(item).map((val) => (
                <td>{val}</td>
              ))}
            </tr>
          ))}
        </table>
      </div>
    </div>
  );
}
